import React from 'react';
import { Link } from 'react-router-dom';
import Footer from '../components/Footer';
import Header from '../components/Header';
import '../styles/Projects.css';

class Projects extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <main>
          <div className="projeto">
            <div className="janelaNavegador">
              <div className="botoes">
                {/* <div className="botao botaoVermelho"></div> */}
                <Link className="botao" to="/" />
                <div className="botao botaoAmarelo"></div>
                <div className="botao botaoVerde"></div>
                <h1>Repositório dos projetos no GitHub</h1>
              </div>
              <p className="projectList">nome</p>
            </div>
          </div>
        </main>
        <Footer />
      </div>
    );
  }
}

export default Projects;
